  input: '"TEXT","F3XA","C00143743","The Texas Republican Congressional Committee
    aka Victory 2002 (FEC ID# C00143743) is in receipt of the Commission''s letter
    dated June 26, 2002 (received by the Committee on July 1, 2002), referencing our
    30-Day Post-Special FEC Report (05/31/01-07/09/01).  In order to comply with the
    Commissions best efforts process, the Committee takes the following steps:  In
    the Committees initial solicitation, the Committee asks each donor for no less
    than the following information: full name, mailing address, occupation and name
    of employer.  Upon receipt of this information, the Committee records it for each
    donor.  Next, within thirty days (normally fifteen days) of receipt of a contribution
    from a donor for which we do not have occupation and employer information, we
    send a letter to the donor that both thanks the donor and again requests that
    the donor provide us with their occupation and employer information.   This letter
    includes a statement about the requirements of federal law.  This letter is also
    accompanied by a self-addressed, stamped envelope.  In addition, all information
    received by the Committee is reported.  Following these procedures, the Committee
    believes it has met the three-part best efforts provisions outlined in your letter.  As
    requested, the Committee reviewed amounts reported on Schedule D of our report.  The
    Committee has determined that as a result of software problems with Aristotles
    Campaign Manager software, all amounts paid were reported as zero ($0.00) for
    each debt on Schedule D.  The beginning balance, amount incurred, and ending balance
    were correct.  Using an updated version of that software provided by Aristotle,
    the Committee has amended its report to correct the amount paid column for each
    debt.  The Committee also discovered that the failure to include the entry on
    Line 11(c) was due to a software glitch and has corrected the error using the
    updated software."'
